"    <div id=\"topicTitle\">",
"     Patient information: What is a sleep study? (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H88711498\">",
"      <span class=\"h1\">",
"       What is a sleep study?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A sleep study is a test that measures how well you sleep and checks for sleep problems. For some sleep studies, you stay overnight in a sleep lab at a hospital or sleep center.",
"     </p>",
"     <p>",
"      In other cases, your doctor can give you a portable sleep monitor to use at home, so you don&rsquo;t have to spend the night in the sleep lab. But you should use a portable monitor only if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Your doctor thinks you have a condition that makes you stop breathing for short periods while you are asleep, called &ldquo;sleep apnea.&rdquo;",
"       </li>",
"       <li>",
"        You do not have other serious medical problems, such as heart disease or lung disease.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H88711513\">",
"      <span class=\"h1\">",
"       What happens during a sleep study?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Before you go to sleep, a technician attaches small, sticky patches called &ldquo;electrodes&rdquo; to your head, chest, and legs. He or she will also place a small tube beneath your nose and might wrap 1 or 2 belts around your chest.",
"     </p>",
"     <p>",
"      Each of these items has wires that connect to monitors. The monitors record your movement, brain activity, breathing, and other body functions while you sleep.",
"     </p>",
"     <p>",
"      If you have a history of trouble falling asleep, your doctor might prescribe a medicine to help you fall asleep in the lab. If you have never taken the medicine before, your doctor might ask you take it on a night before your sleep study to see how it affects you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H88711530\">",
"      <span class=\"h1\">",
"       Why might my doctor order a sleep study?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor will order a sleep study if he or she thinks you have sleep apnea or a different condition that makes you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Have sudden jerking leg movements while you sleep, called &ldquo;periodic limb movement disorder.&rdquo;",
"       </li>",
"       <li>",
"        Feel very sleepy during the day and fall asleep all of a sudden, called &ldquo;narcolepsy.&rdquo;",
"       </li>",
"       <li>",
"        Have trouble falling asleep or staying asleep over a long period of time, called &ldquo;chronic insomnia.&rdquo;",
"       </li>",
"       <li>",
"        Do odd things while you sleep, such as walking.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H88711547\">",
"      <span class=\"h1\">",
"       How should I prepare for a sleep study?",
"      </span>",
"      &nbsp;&mdash;&nbsp;On the day of your sleep study, you should:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Avoid alcohol",
"       </li>",
"       <li>",
"        Avoid drinking coffee, tea, sodas, and other drinks that have caffeine in the afternoon and evening",
"       </li>",
"       <li>",
"        Take all of your regular medicines",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H88711562\">",
"      <span class=\"h1\">",
"       More on this topic",
