var title_f35_5_35924="Reprogramming adult cells to become pluripotent cells";
var content_f35_5_35924=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F81456&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F81456&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 629px\">",
"   <div class=\"ttl\">",
"    Reprogramming adult cells to become pluripotent cells",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 609px; height: 325px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The introduction of defined factors (as genes, mRNA, or a combination with small molecules) permits the gradual reversion of a mature, somatic cell, such as a skin fibroblast, to an induced pluripotent (iPS) cell. Sequential changes in the targeted cell are thought to proceed in an orderly manner as indicated.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Stadtfeld M, Hochedlinger K. Induced pluripotency: history, mechanisms, and applications. Genes Dev 2010; 24:2239. Copyright &copy; 2010 Cold Spring Harbor Laboratory Press.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
