"      (C) Posteroanterior and lateral angiograms of a patient with a tripartite RV after surgery for PA/IVS. The pulmonary valve leaflets are evident and there is a well-formed inlet, body, and infundibulum of the RV. Coronary connections from the RV are present, but less prominent than in angiograms A and B. (* denotes coronary connections filled from the RV).",
