var title_f35_5_35932="von Reyn criteria for IE";
var content_f35_5_35932=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F52313&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F52313&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    von Reyn criteria for diagnosis of infective endocarditis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Definite IE",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Direct evidence of infective",
"endocarditis based on histology from surgery or autopsy, or on",
"bacteriology (Gram stain or culture) of valvular vegetation or peripheral",
"embolus.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Probable IE",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"1\">",
"        Persistently positive blood cultures",
"(at least two blood cultures obtained, with two of two positive, three",
"of three positive, or at least 70% of",
"cultures positive if four or more cultures obtained) plus",
"        <strong>",
"         one",
"        </strong>",
"        of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"1\">",
"        New regurgitant murmur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Predisposing heart",
"disease and vascular phenomena",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"1\">",
"        Negative or intermittently positive",
"blood cultures (ie, blood culture positivity that does not meet the",
"above criteria) plue",
"        <strong>",
"         three",
"        </strong>",
"        of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        New regurgitant murmur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"1\">",
"        Vascular phenomena -",
"petechiae, splinter hemorrhages, conjunctival hemorrhages, Roth spots,",
"Osler's nodes, Janeway lesions, aseptic meningitis,",
"glomerulonephritis, or pulmonary, central nervous system, coronary or peripheral emboli",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Possible IE",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Persistently positive blood cultures plus",
"        <strong>",
"         one",
"        </strong>",
"        of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Predisposing heart",
"disease - definite valvular or congenital heart disease, or a cardiac",
"prosthesis (excluding permanent pacemakers)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Vascular",
"phenomena",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Negative or intermittently positive blood cultures with",
"        <strong>",
"         all three",
"        </strong>",
"        of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Predisposing heart",
"disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Vascular",
"phenomena",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        For viridans streptococcal cases",
"only: at least two positive blood cultures without an extracardiac",
"source, and fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Rejected IE",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Endocarditis unlikely, alternative diagnosis generally",
"apparent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Endocarditis likely, empiric antibiotic therapy",
"warranted",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Culture negative endocarditis",
"diagnosed clinically, but excluded by postmortem",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
